import React, { useState } from 'react'
import './styles/style.css'
import useInterval from './useInterval'

function App() {
  let height = Math.floor(Math.random()*50)
  const [left, setLeft] = useState(95)
  const style = {
    left: `${left}%`,
    height: `${height}%`
  }
  
  function moveObject(){
    setLeft((item)=> item-5)
  }

 let moveInterval =  useInterval(moveObject,2000)
  console.log(height)

  if(left<=0){
    clearInterval(moveInterval)
  }


  function generateObstacles(){
    return (<div className="obstacle" style={style}></div>)
  }

  
  return (
    <div className="canvas">
      <div className="obstacles">
        {generateObstacles()}
      </div>
    </div>
  )
}

export default App
